import emailjs from "emailjs-com";

export const SendEmail = (Mail_data) => {
  emailjs
    .send(
      'my_service_foodapp',
      'template_52ezmwp',
      Mail_data,
      'IZCUb8IpfQB6g5Hzj'
    //   `${process.env.REACT_APP_USER_ID}`
    )
    .then(
      function (response) {
        console.log("SUCCESS!", response.status, response.text);
      },
      function (error) {
        console.log("FAILED...", error);
      }
    );
};
